    false,nt"url": null,nt"notes": "This map shows trends in unusually hot
    and cold temperatures at individual weather stations that have operated consistently
    since 1948. In this case, the term u201cunusually hotu201d refers to a daily maximum
    temperature that is hotter than the 95th percentile temperature during the 1948u20132015
    period. Thus, the maximum temperature on a particular day at a particular station
    would be considered u201cunusually hotu201d if it falls within the warmest 5 percent
    of measurements at that station during the 1948u20132015 period. The map shows changes
    in the total number of days per year that were hotter than the 95th percentile.
    Red upward-pointing symbols show where these unusually hot days are becoming more
    common. Blue downward-pointing symbols show where unusually hot days are becoming
    less common. For more information: www.epa.gov/climatechange/science/indicators",nt"license_title":
